<style>
/* Global Mobile Overrides for very small screens */
@media (max-width: 300px) {
  .reveal, .reveal .slides, .reveal .slides section {
    width: 100vw !important;
    height: 100vh !important;
    margin: 0 !important;
    padding: 0 !important;
    transform: none !important;
  }
}

.slide-content-grid {
  display: flex;
  align-items: center;
  justify-content: space-between;
  gap: 40px;
  padding: 20px;
  max-width: 90%;
  margin: 0 auto;
}

.slide-text {
  flex: 1.2;
  text-align: left;
  font-size: 1em;
  line-height: 1.5em;
}

.slide-img-right,
.slide-img-left {
  flex: 0.8;
  max-width: 60%;
}

.slide-img-right img,
.slide-img-left img {
  width: 100%;
  height: auto;
  display: block;
}

.slide-img-right {
  order: 2;
}

.slide-img-left {
  order: 0;
}

/* Optional: stack vertically on mobile */
@media (max-width: 700px) {
  .slide-content-grid {
    flex-direction: column;
    text-align: center;
  }

  .slide-img-right,
  .slide-img-left {
    order: 0;
    max-width: 100%;
  }
}

/* === Text with Small Logo Image === */
.slide-with-logo {
  display: flex;
  align-items: center;
  justify-content: flex-start;
  gap: 20px;
  padding: 20px;
  max-width: 80%;
  margin: 0 auto;
  text-align: left;
}

.slide-with-logo img {
  width: 150px;
  height: auto;
  flex-shrink: 0;
}

.logo-fixed {
  position: fixed;
  bottom: 12px;
  right: 12px;
  width: 140px;
  height: 80px;
  background: url('src/decks/img/logo_green.png') no-repeat center center;
  background-size: contain;
  opacity: 0.9;
  z-index: 1000;
  pointer-events: none;
}

  align-items: center;
  justify-content: center;
  gap: 20px;
  margin: 0 auto;

.phone-frame-clip {
  overflow: visible; /* No clipping on desktop */
}

  white-space: normal; /* Ensure the text wraps within the container */
}

/* ----- Mobile (max-width: 500px) Layout ----- */
@media (max-width: 500px) {
  /* Force slide content to align at the top */
  .reveal .slides section {
    display: block !important;
    margin: 0 !important;
    padding: 0 !important;
    transform: none !important;
  }
  
  /* Reduce header sizes so the slide title doesn't dominate */
  .reveal .slides section h1,
  .reveal .slides section h2,
  .reveal .slides section h3 {
    font-size: 0.9em !important;
    margin: 0.2em 0 !important;
    padding: 0 !important;
    line-height: 1em !important;
    text-align: center;
  }

  /* Also reduce regular text (paragraphs and list items) on mobile */
  .reveal .slides section p,
  .reveal .slides section li {
    font-size: 0.6em !important;
    line-height: 1.2em !important;
  }

  .phone-frame-container {
    display: flex;
    flex-direction: column;  /* Stack image and caption vertically */
    justify-content: center; /* Vertically center content */
    align-items: center;  /* Horizontally center content */
    width: 100vw;
    height: 100vh;  /* Full height of the viewport */
    padding-left: 10vw;  /* Horizontal padding (left side) */
    padding-right: 10vw; /* Horizontal padding (right side) */
    padding-top: 0;   /* No top padding */
    padding-bottom: 0; /* No bottom padding */
    text-align: center;
    gap: 5px;  /* Reduced gap between image and caption */
  }
  
  /* Reserve about 55% of viewport height for the image area */
  .phone-frame-clip {
    width: 80%;

    height: 50vh; 
  }
  
  /* Make sure the image fills its container but smaller */
  .phone-frame-image {
    width: 70%;  /* Reduced width from 90% to 70% */
    height: 92%;  /* Reduced height from 90% to 70% */
    background-size: cover;
    background-position: center;
  }

    width: 70%;

  }

  /* Caption area: Allow for longer content with better wrapping and center it */
  .phone-frame-caption {
    font-size: 0.5em;
    text-align: left;  /* Center the text horizontally */
    width: 80%;  /* Make caption width 80% of the screen */
    height: auto; /* Allow the height to grow based on content */
    overflow: visible;  /* Allow content to be fully visible */
    margin-top: 10px;
    margin-left: auto;   /* Center the caption horizontally */
    margin-right: 50px;  /* Center the caption horizontally */

  <script>
    (function() {
      var isMobile = window.innerWidth < 600; 

      Reveal.initialize({
        controls: true,
        progress: true,
        slideNumber: true,
        touch: true,
        hash: true,
        transition: 'slide',
        mobileViewDistance: 1,
        plugins: [ RevealMarkdown, RevealMermaid ],
        mermaid: { theme: 'dark' },
        center: !isMobile,
        width: isMobile ? window.innerWidth : 1280,
        height: isMobile ? window.innerHeight : 720,
        touch: {
          swipe: true,
          maxTaps: 1
        },
        minScale: isMobile ? 1 : 0.5,
        maxScale: isMobile ? 1 : 2
      });
    })();

    document.getElementById('fullscreenBtn').addEventListener('click', function() {
      if (!document.fullscreenElement) {
        document.documentElement.requestFullscreen().catch(err => {
          console.error(`Error attempting to enable fullscreen mode: ${err.message} (${err.name})`);
        });
      } else {
        document.exitFullscreen();
      }
    });
  </script>

  <script>
    document.addEventListener('DOMContentLoaded', function() {
      var codeBlocks = document.querySelectorAll('pre code.language-mermaid');
      codeBlocks.forEach(function(block) {
        var mermaidDiv = document.createElement('div');
        mermaidDiv.className = 'mermaid';
        mermaidDiv.textContent = block.textContent.trim();
        block.parentNode.parentNode.replaceChild(mermaidDiv, block.parentNode);
      });
      if (typeof mermaid !== 'undefined') {
        mermaid.init(undefined, document.querySelectorAll('.mermaid'));
      }
    });
  </script>
